import React, { Component } from 'react';

class TicketByStatusComponent extends Component {

    constructor(props){
        super(props)
        this.state = {
            tickets: '',
            status: ''
        }
        this.submitStatus = this.submitStatus.bind(this);
        this.changeStatusHandler = this.changeStatusHandler.bind(this);
    }

    changeStatusHandler = (event) =>{
        this.setState({status: event.target.value})
    }



    submitStatus(){
       this.props.history.push(`/ListSingularTicketStatus/${this.state.status}`);
    }
    
    render() {
        return (
            <div>
            <h2 className="text-centre"> Tickets</h2>
            
                <div className = "row"> 
                    <table className ="table table-striped table-bordered" >
                        <thead> 
                            <tr>
                                <th>id </th>
                                <th>author </th>
                                <th>description </th>
                                <th>title </th>
                                <th>status </th>
                            </tr>
                        </thead>

                        <tbody>
                            {
                                this.state.tickets.map(
                                    tickets =>
                                    <tr key = {tickets.id}>
                                        <td>{tickets.id}</td>
                                        <td>{tickets.author}</td>
                                        <td>{tickets.description}</td>
                                        <td>{tickets.title}</td>
                                        <td>{tickets.status}</td>
                                    </tr>
                                )
                            }
                        </tbody>

                    </table>
                </div>
            </div>
             
        )
    }
            
}

export default TicketByStatusComponent;
